<script>
$(document).ready(function() {
    // Valor de Foliopermi
    var folio = "<?php echo $fila['Foliopermi']; ?>";

    // Realiza una solicitud AJAX a qr.php para obtener el c√≥digo QR
    $.ajax({
        url: 'qrlic.php',
        type: 'POST', // o 'GET' dependiendo de c√≥mo quieras enviar el valor de Foliopermi
        data: { Foliopermi: folio },
        success: function(response) {
            sessionStorage.setItem("imagenfolio", response);
            // Una vez guardado en sessionStorage, puedes cargar el HTML
            cargarHTML();
        },
        error: function() {
            alert('Error al cargar el c√≥digo QR.');
        }
    });
});

function cargarHTML() {
    var qr_image_url = sessionStorage.getItem("imagenfolio");

    // Verificar si el valor no es nulo o indefinido
    if (qr_image_url) {
        // Obtener el div por su ID
        var imagenFolioDiv = document.getElementById("imagenFolioDiv");
        imagenFolioDiv.innerHTML = qr_image_url;
    } else {
        // Si el valor es nulo o indefinido, mostrar un mensaje de error
        console.error("El valor de 'imagenfolio' en sessionStorage no est√° definido.");
    }
}
</script>

